नोट्स लेना चाहते हैं और अपने लिए त्वरित अनुस्मारक बनाना चाहते हैं?

अब आप हमारे नोटपैड सॉफ्टवेयर का उपयोग करके ऐसा कर सकते हैं। इसका उपयोग आसान है। {{}

बस नोट का शीर्षक लिखें
विवरण / सुविधाओं में जोड़ें
नोट सहेजें। {{}

आप जितने चाहें उतने नोट जोड़ सकते हैं और जल्दी से नोट भी हटा सकते हैं। {२}

आज इस नोटपैड सॉफ़्टवेयर का उपयोग करके अपने यादृच्छिक विचारों / नए व्यावसायिक विचारों को लिखें। {३}

अस्वीकरण: कृपया ध्यान दें कि यह एक्सटेंशन Google द्वारा नहीं बनाया गया है और यह एक स्वतंत्र विकास दल द्वारा बनाया गया है। समस्त कॉपीराइट उनके संबंधित स्वामियों की संपत्ति हैं।
Google इस Chrome एक्सटेंशन का समर्थन या प्रायोजन नहीं करता है। नोटपैड - नोट्स और वीकली प्लानर के स्वामित्व में नहीं है, इसके द्वारा लाइसेंस प्राप्त नहीं है और यह Google इंक की सहायक कंपनी नहीं है।
